class TS extends React.Component{
  constructor(props){
    super(props);
   this.state={
     nol:['antonio','b']
   }
  }
  change=(event)=>{
    this.setState({nol:Array.from(event.target.selectedOptions).map(o=>o.value)})
  }
  render(){
    return(
      <div>
        {JSON.stringify(this.state.nol)}
        <select onChange={this.change} multiple>
          <option>1</option>
          <option>2</option>
          <option>3</option>
